BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "users" (
	"id"	INTEGER NOT NULL,
	"t_id"	INT UNIQUE,
	"name"	TEXT,
	"lname"	TEXT,
	"uname"	TEXT,
	"n_time"	NUMERIC,
	"inf"	TEXT,
	"auth"	INTEGER,
	"chname"	INTEGER,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "mat" (
	"id"	INTEGER,
	"badw"	TEXT UNIQUE,
	"without"	TEXT,
	"inf"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "with" (
	"id"	INTEGER,
	"word"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
COMMIT;
